sparql:
SELECT distinct ?uri ?image ?createur ?createurLabel ?titre_fr 
WHERE {  
  {
    SELECT distinct ?uri where {  ?uri wdt:P136 wd:Q40446;
                                       wdt:P31 wd:Q3305213;
                                       (wdt:P7420| wdt:P18) ?image .
                                optional { ?uri wdt:P1476 ?titre_fr }
                                filter(lang(?titre_fr)='fr')    
                               }    
  }  
  ?uri wdt:P136 wd:Q40446;      
       (wdt:P7420| wdt:P18) ?image ;
       wdt:P31 wd:Q3305213;
       wdt:P170 ?createur .
  ?createur rdfs:label ?createurLabel .
  filter(lang(?createurLabel)='fr')
  optional { ?uri wdt:P1476 ?titre_fr }
  filter(lang(?titre_fr)='fr')
}
